import networkx as nxG = nx.read_edgelist("edgeList_full.txt", create_using=nx.DiGraph())pr = nx.pagerank(G, alpha=0.85, personalization=None, max_iter=30, tol=1e-06, nstart=None, weight='weight',dangling=None)page_rank_file = open("external_pageRankFile.txt", "w+")for key in pr:    page_rank_file.write("/Users/ShobhitAgarwal/Downloads/NBCNewsData/NBCNewsDownloadData/" + key.strip() + "=" + ("%.5f" % pr[key]) + "\n")page_rank_file.close()